import Link from "next/link";
import { Layout } from "../../components/Layout";

export function BlogLink({ id, children }) {
  return (
    <li>
      <Link href={`/blog/${id}`}>
        <a>{children}</a>
      </Link>
    </li>
  );
}

function Blog() {
  return (
    <Layout>
      <h2>This is the blog page index</h2>
      <ul>
        <BlogLink id="batman">First Blog</BlogLink>
        <BlogLink id="spiderman">Second Blog</BlogLink>
        <BlogLink id="xmen">Third Blog</BlogLink>
      </ul>
    </Layout>
  );
}

export default Blog;
